MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre Query Server is an intermediary between databases in a Standard Verification Database (SVDB) and another client application, such as a script or user interface. While the Query Server is primarily intended for program-to-program communication, you can also use it from the command line to examine the contents of an SVDB.");
MGCAddSnippet(6, "The Query Server operates on databases contained in an SVDB. The Query Server has a variety of database outputs that allow for inspection of your designs, as well as for use in downstream simulation tools. ");
MGCAddSnippet(7, "An SVDB directory contains the databases that the Query Server accesses.");
MGCAddSnippet(8, "The databases available to the Query Server for probing define the mode in which the Query Server can operate. In each mode, a different set of commands can be used. ");
MGCAddSnippet(9, "Devices in a Query Server database correspond to devices recognized during circuit extraction by using Device statements in the rule file. The set of recognized devices and the set of badly formed devices (if any) can be accessed by using various Query Server commands.");
MGCAddSnippet(10, "Nets in an SVDB may be referenced by name or by number and correspond to the net IDs in an extracted layout netlist. Depending on the command, either the net name or the numeric ID is returned.");
MGCAddSnippet(11, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(12, "The Tcl shell is a component of the Query Server that is called by the calibre -qs command. The Tcl shell responds to Query Server Tcl commands, general Tcl commands, and certain shell commands from the host operating system.");
MGCAddSnippet(13, "You can invoke the Tcl shell from your usual terminal session. You can issue commands directly at the command line prompt or in batch mode using a Tcl command file. ");
MGCAddSnippet(14, "You should know some fundamental Tcl language ideas when using the Tcl shell.");
MGCAddSnippet(15, "The Query Server Tcl shell provides a number of command types that are useful for accessing data in an SVDB directory.");
MGCAddSnippet(16, "The administrative commands provide high-level control of the Query Server Tcl shell and session information. ");
MGCAddSnippet(17, "Calibre Connectivity Interface (CCI) functions, which include annotated geometry format (AGF) commands, are implemented in both the Calibre Query Server Tcl shell and in Calibre YieldServer.");
MGCAddSnippet(18, "Design data query commands return information about the layout or source design and, in some cases, navigate design hierarchy. In certain cases, the commands return iterators, which are opaque objects referencing design elements.");
MGCAddSnippet(19, "Device commands provide information about layout devices.");
MGCAddSnippet(20, "LVS Custom Report commands allow you to configure an LVS report.");
MGCAddSnippet(21, "The LVS rule file query commands return information about settings in the LVS rules. These commands are helpful in certain third-party tool flows that require information about the contents of the Standard Verification Database (SVDB).");
MGCAddSnippet(22, "The net commands query information about layout nets.");
MGCAddSnippet(23, "Netlisting commands read, configure, or write SPICE netlists.");
MGCAddSnippet(24, "Port commands provide information about layout ports.");
MGCAddSnippet(25, "The short isolation commands provide access to Calibre short isolation functionality through the data stored in the PHDB. ");
MGCAddSnippet(26, "The short repair database commands allow you to manage the process of fixing shorts. To apply shorts database commands, the underlying PHDB database must have been created using the Mask SVDB Directory SI option, except in the Calibre nmLVS Reconnaissance Short Isolation flow. In the latter case, the PHDB can be created by any keyword that produces this database.");
MGCAddSnippet(27, "The soft connection checking commands access LVS Softchk data stored or perform soft connection checks on layer data stored in the PHDB.  The qs::softchk and qs::softchks commands are only functional in Calibre nmLVS Reconnaissance. They do not work in the Query Server Tcl shell. They are documented here because they are in the qs:: scope.");
MGCAddSnippet(28, "Hcell lists can be generated using a subset of Tcl shell commands.");
MGCAddSnippet(29, "Commands in this category perform unique functions unrelated to other commands.");
MGCAddSnippet(30, "A subset of Calibre YieldServer commands are supported in the Query Server Tcl shell.");
MGCAddSnippet(31, "You can issue the command qs::help in the shell to see a list of all the commands. Complete reference descriptions appear on the following pages.");
MGCAddSnippet(32, "Suppresses short isolation on a specified layer.");
MGCAddSnippet(33, "Adds a text object to a short iterator.");
MGCAddSnippet(34, "Closes the database without quitting Query Server.");
MGCAddSnippet(35, "Returns a 1 if the LVS comparison summary information is available. Otherwise a 0 is returned.");
MGCAddSnippet(36, "Creates a copy of an SVDB database.");
MGCAddSnippet(37, "Writes an LVS summary report to an output file. ");
MGCAddSnippet(38, "Deletes all mask polygons generated using the qs::add_mask_polygon command that exist in the specified iterator.");
MGCAddSnippet(39, "Deletes a text label in the short isolation session.");
MGCAddSnippet(40, "Returns a table of information about all devices in the layout design. ");
MGCAddSnippet(41, "Returns lists of the instances formed during device recognition, along with associated statistics. Device types and subtypes that are not used to generate instances (as in LVS Box cells) are not output.");
MGCAddSnippet(42, "Indicates whether a layout or source device path is valid. ");
MGCAddSnippet(43, "Returns a 1 if connectivity extraction summary information is available. Otherwise a 0 is returned.");
MGCAddSnippet(44, "Writes a results database containing shapes external to a given cell that interact with a net in the cell.");
MGCAddSnippet(45, "Returns data from a short iterator.");
MGCAddSnippet(46, "Returns the pathname of a device placement at a specified location. The specified query location is in top-cell space. The query includes all levels of hierarchy beneath the specified location. The cell context can be optionally changed to any cell. Devices that are queried can optionally be filtered by seed layer, device name, or device ID by specifying a filter object. Data coordinates can be transformed through the filter object also.");
MGCAddSnippet(47, "Returns the pathname of a net placement at a specified location. The specified query location is in top-cell space. The cell context can be optionally changed to any cell. The query includes all levels of hierarchy beneath the specified location. If a net has a name, it is returned as the terminal element of the pathname; otherwise, node IDs are returned. Nets that are queried can optionally be filtered by layer by specifying a filter object. Data coordinates can be transformed through a filter object also.");
MGCAddSnippet(48, "Returns the pathname and cell name of a placement at a specified location. By default, the specified query location is in top-cell space and at the top level of the hierarchy. The cell context can be optionally changed to any cell, and the hierarchy can be treated as flattened. Data coordinates can be transformed through a filter object. Data is returned in a Tcl list. ");
MGCAddSnippet(49, "Collects information for a custom LVS Summary Report. Gets the information to create a custom LVS Summary Report. Time data is presented in seconds since the last epoch. If data is not available, the server returns an empty string or 0.");
MGCAddSnippet(50, "Creates a short iterator used for input to other commands.");
MGCAddSnippet(51, "Displays a table of all Query Server Tcl shell commands.");
MGCAddSnippet(52, "Increments an iterator to point to the next entry in the sequence. ");
MGCAddSnippet(53, "Performs short isolation using an iterator.");
MGCAddSnippet(54, "Isolates shorts from an SVDB database.");
MGCAddSnippet(55, "Lists the mask polygons in the system.");
MGCAddSnippet(56, "Returns information about original short circuit elements as a Tcl list.");
MGCAddSnippet(57, "Returns a list of text labels in the system.");
MGCAddSnippet(58, "Returns a list of instance paths of all devices on a specified layout net.");
MGCAddSnippet(59, "Returns a list of layers that comprise a net.");
MGCAddSnippet(60, "Returns placements of a layout cell for which a specified net is not connected to a reference net.");
MGCAddSnippet(61, "Returns names and locations of intentional device pins on a layout net.");
MGCAddSnippet(62, "Returns the mapping of layout net names to system-generated node numbers.");
MGCAddSnippet(63, "Returns the path of the highest representative of a net and all intermediate net pathnames between the net and its highest representative. The specified net path is also returned. This command requires the layout to be geometric.");
MGCAddSnippet(64, "Indicates whether a layout or source net path is valid. ");
MGCAddSnippet(65, "Opens an SVDB database.");
MGCAddSnippet(66, "Returns cell names corresponding to instances in an instance pathname in a Tcl list of lists. For primitive devices, returns their Device type and subtype (if any). Net names that terminate a path are returned in a separate list.");
MGCAddSnippet(67, "Sets a password for the current SVDB.");
MGCAddSnippet(68, "Starts the performance monitor.");
MGCAddSnippet(69, "Indicates whether a layout or source placement path is valid. ");
MGCAddSnippet(70, "Returns information about original short circuit elements.");
MGCAddSnippet(71, "Exits the Query Server Tcl shell. The command qs::exit is an alias and performs the same function. Alternatively, you can type  exit .");
MGCAddSnippet(72, "Returns a 1 if ERC has been run. Otherwise, a 0 is returned.");
MGCAddSnippet(73, "Returns a 1 if LVS Softchk has been run. Otherwise a 0 is returned.");
MGCAddSnippet(74, "Returns rule file connectivity statement information.");
MGCAddSnippet(75, "Returns the name of the rule file used to create the SVDB database.");
MGCAddSnippet(76, "Returns a Tcl list of lists of rule file layers and their types.");
MGCAddSnippet(77, "Returns the Layout Case setting in the rule file. ");
MGCAddSnippet(78, "Returns the LVS Compare Case keyword settings in the rule file: NO, YES, NAMES, TYPES, SUBTYPES, or VALUES as a Tcl list.");
MGCAddSnippet(79, "Returns the LVS DB Layer parameters in the rule file as a Tcl list of layer names.");
MGCAddSnippet(80, "Returns the LVS DB Connectivity Layer parameters in the rule file as a Tcl list of layer names.");
MGCAddSnippet(81, "Returns the LVS Downcase Device setting in the rule file. 0 is NO, 1 is YES.");
MGCAddSnippet(82, "Returns the LVS Ground Name setting of the rule file.");
MGCAddSnippet(83, "Returns the LVS Power Name setting of the rule file.");
MGCAddSnippet(84, "Returns the LVS Spice Replicate Devices setting in the rule file. 0 is NO, 1 is YES.");
MGCAddSnippet(85, "Returns the Precision setting in the rule file as a floating-point number.");
MGCAddSnippet(86, "Returns the Source Case setting in the rule file. 0 is NO, 1 is YES.");
MGCAddSnippet(87, "Returns the Unit Length setting in the rule file. The return value is in meters and represented in scientific notation.");
MGCAddSnippet(88, "Performs soft connection checks in a Calibre nmLVS Reconnaissance run on specified layers that exist in the PHDB.");
MGCAddSnippet(89, "Performs soft connection checks in a Calibre nmLVS Reconnaissance run on the data in the PHDB.");
MGCAddSnippet(90, "Provides the state of server settings. By default, only -phdb and -xdb option data is reported. Other settings are reported when explicitly specified.");
MGCAddSnippet(91, "Writes the summary comparison information to an output file. The created file should be opened for write access using the Tcl open command as a part of a summary report generation script.");
MGCAddSnippet(92, "Writes the summary extraction information to an output file. The created file should be opened for write access the Tcl open command as a part of a summary report generation script.");
MGCAddSnippet(93, "Suppresses short isolation on a specified layer.");
MGCAddSnippet(94, "Adds a text object to the short isolation database.");
MGCAddSnippet(95, "Assigns or de-assigns a short to a specific user. If -sn is not specified, then the current short serial number is assumed. If -uid or -login are not specified, then the current user s ID is assumed. Assignments can be reviewed with the command short_db::user_info -show.");
MGCAddSnippet(96, "Adds or returns comments on a short. Returns comments if -text is not specified. If -sn is not specified, then the current short s serial number is used. ");
MGCAddSnippet(97, "Deletes all mask polygons added using the short_db::add_mask_polygon command that correspond to a serial number.");
MGCAddSnippet(98, "Deletes a text object in the short isolation database.");
MGCAddSnippet(99, "Returns the name of the change set of the current short. Change sets contain records of any attempts to isolate or modify the properties of a short.");
MGCAddSnippet(100, "Returns the current short s serial number. A serial number is assigned to each short in the SVDB database, indexed from 0.");
MGCAddSnippet(101, "Returns a status name of a short.");
MGCAddSnippet(102, "Makes the short with a specified serial number the current short.");
MGCAddSnippet(103, "Isolates a short in the shorts database.");
MGCAddSnippet(104, "Finds shorts in the short isolation database.");
MGCAddSnippet(105, "Returns a list of all change sets. Change sets contain records of any attempts to isolate or modify the properties of a short. The change set must have changes in it in order to be listed.");
MGCAddSnippet(106, "Returns information about original short circuit elements as a Tcl list.");
MGCAddSnippet(107, "Returns a list of text labels in the shorts database.");
MGCAddSnippet(108, "Marks the short associated with the serial number as  FIXED .");
MGCAddSnippet(109, "Returns information about original short circuit elements.");
MGCAddSnippet(110, "Deletes the contents of a change set.");
MGCAddSnippet(111, "Renames a change set.");
MGCAddSnippet(112, "Selects Connect and Sconnect operations to be processed during stand-alone short isolation. The layer names specified in this command correspond to those in the rule file used to generate the PHDB. This command is only valid when used in Calibre nmLVS Reconnaissance Short Isolation (Calibre nmLVS Recon SI) scripts.");
MGCAddSnippet(113, "Configures runtime parameters for remote hosts in a stand-alone short isolation run that specifies a Query Server script.");
MGCAddSnippet(114, "Assigns or removes a status label. By default, this occurs for the current short. If the -sn option is used, then that short s status label is affected. ");
MGCAddSnippet(115, "Reports the changes in a change set.");
MGCAddSnippet(116, "Defines a new change set.");
MGCAddSnippet(117, "Shows or modifies user information for a short.");
MGCAddSnippet(118, "This procedure takes you through the process of running the short database commands. They are used to store the current state of short isolation information in a persistent database.");
MGCAddSnippet(119, "This procedure shows how to create a custom LVS report.");
MGCAddSnippet(120, "Hcells define correspondences between layout and source cells in hierarchical LVS. Calibre nmLVS-H cannot generally determine these correspondences if the subcircuit names are different in the two designs, so a user-defined hcell list is needed in that case. Furthermore, simply because cell names may match between layout and source designs does not mean the pair will make good hcells. The Query Server can assist in finding a prospective set of hcells that act as design partitions to improve comparison efficiency and to make debugging simpler. ");
MGCAddSnippet(121, "The Query Server maintains an internal list of hcells called the current hcell list. Hcells are added to this list by reading the rule file, by reading an hcell list file, by specifying individual hcell pairs in Query Server commands, or by adding automatically matched hcells. Hcells can be removed from the current list either globally or by specifying individual pairs to be excluded. The current hcell list is used for Query Server analysis and reporting functions, as well as to select a list of hcells to be used for testing in LVS.");
MGCAddSnippet(122, "Hcells in the current hcell list should be evaluated for their effectiveness in LVS comparison. This can be done initially in the Query Server Tcl shell. Ultimately, every hcell list used for LVS comparison should be tested in Calibre nmLVS-H.");
MGCAddSnippet(123, "The hcell analysis feature is typically used for LVS comparison when layout and source are both SPICE netlists. However, the hcell analysis can be used when the layout is geometric. This method has the disadvantage that the devices and connectivity from the layout have not yet been extracted, so comparison performance estimations are done entirely with the source netlist.");
MGCAddSnippet(124, "Hcell selection is useful feature when given a design with no hcell list or with a poor hcell list. However, limitations exist in automatic hcell selection.");
MGCAddSnippet(125, "The hcell analysis and hierarchy tree reports are useful for finding hcells for hierarchical LVS comparison. The report ranks cells in order of potential value as hcells (assuming that a matching hcell can be found). ");
MGCAddSnippet(126, "Hcell analysis commands provide information for constructing preliminary hcell correspondence lists.");
MGCAddSnippet(127, "Adds cells identified with the hcells::automatch or hcells::placementmatch commands to the current hcell list. Without this command, automatically matched hcells are not considered when producing the hcell analysis and hierarchy tree report.");
MGCAddSnippet(128, "Identifies layout and source cells that match by name.");
MGCAddSnippet(129, "Removes a corresponding cell pair from the current hcell list.");
MGCAddSnippet(130, "Removes all corresponding cell pairs from the current hcell list.");
MGCAddSnippet(131, "Controls hcell effectiveness evaluation.");
MGCAddSnippet(132, "Controls unbalanced hcell expansion.");
MGCAddSnippet(133, "Adds a single hcell pair to the current hcell list. The cells should be topologically identical, otherwise unpredictable problems can occur in LVS comparison.");
MGCAddSnippet(134, "Creates a current hcell list from an hcell file. The current hcell list, if any, is cleared first.");
MGCAddSnippet(135, "Identifies corresponding layout and source cells by placement count.");
MGCAddSnippet(136, "Writes the current list of hcells.");
MGCAddSnippet(137, "Writes a hierarchy tree report of cell statistics.");
MGCAddSnippet(138, "Reads in the layout and source netlists, along with any Hcell statements that may be in the rule file.");
MGCAddSnippet(139, "Selects hcells in the current hcell list and any automatically matched cells. Generates a report of the current hcell statistics.");
MGCAddSnippet(140, "Displays the settings of the hcell evaluation system. ");
MGCAddSnippet(141, "Hcell analysis report showing the effectiveness of hcells.");
MGCAddSnippet(142, "Hcell analysis statistics report used for selection of hcell list pairs. It provides an estimate of the percentage in memory savings if a cell is used as an hcell, which is a useful evaluation criterion.");
MGCAddSnippet(143, "Hcells are said to be unbalanced when the cell counts differ in layout and source for a given hcell. ");
MGCAddSnippet(144, "The Query Server Hcell Analysis functionality includes the ability to create hcell matches between cells having a similar number of placements in the layout and source. ");
MGCAddSnippet(145, "There are a number of foundational ideas you should know when using the Query Server in standard mode (non-Tcl shell). You should familiarize yourself with them before using the tool.");
MGCAddSnippet(146, "Calibre Query Server standard command line. ");
MGCAddSnippet(147, "Standard Query Server commands elicit an acknowledgment message upon execution. An acknowledgment is a single string of text beginning with three spaces and terminated by a carriage return character. Acknowledgments are documented for all commands that produce them in a subsection of the same name in the command reference pages.");
MGCAddSnippet(148, "A response is an output from a command that contains an extended form of design data. A response file is an ASCII file containing responses that can be read by a client. ");
MGCAddSnippet(149, "Because of the hierarchical nature of the data on which the Query Server typically operates, the client application must provide the Query Server with a context within which to interpret command arguments. ");
MGCAddSnippet(150, "The Query Server standard mode is designed for multiple client contexts. From the server s point of view, client contexts are created, go through phases of being active and inactive, and eventually are deleted. Exactly one client context is active at any given time and is called the current client.");
MGCAddSnippet(151, "The standard mode Query Server responds to commands that query SVDB databases and the server environment. All commands return a brief acknowledgment upon execution. Some commands return a more verbose response. In either case, the reference pages discuss the messages that the server returns. For commands that have counterparts in the Query Server Tcl shell, the Tcl command equivalents are shown in the header of each reference page. The Tcl shell is the preferred interface.");
MGCAddSnippet(152, "Each standard query command is a single string of text terminated by a return character. Commands may be issued directly in the server shell, or they may appear in a script. The words chosen to represent a command are a compromise between brevity and ease of human recognition. Later sections cover each command in detail.");
MGCAddSnippet(153, "This set of commands is used for communication and control between the Query Server and the client.");
MGCAddSnippet(154, "Activates a server client.");
MGCAddSnippet(155, "Connects a new client to the server.");
MGCAddSnippet(156, "Disconnects a client from the server.");
MGCAddSnippet(157, "Controls repetition of inputs in the output.");
MGCAddSnippet(158, "Lists the Query Server commands.");
MGCAddSnippet(159, "Sets a password for the current SVDB.");
MGCAddSnippet(160, "Exits the Query Server. Performs identically to the TERMINATE command.");
MGCAddSnippet(161, "Sets the Query Server response message channel to STDOUT, which is the default. If a response file exists at the time this command is processed, it is retained.");
MGCAddSnippet(162, "Specifies an output file for server responses.");
MGCAddSnippet(163, "Specifies error and NOK message handling behavior.");
MGCAddSnippet(164, "Exits the Query Server.");
MGCAddSnippet(165, "Certain commands (generally those that take a while to complete) terminate in response to the SIGINT signal. When the Query Server is run using a shell command line, this signal can be sent by the ^C keystroke. This signal can be sent to the process using the kill system call on Unix-type systems. ");
MGCAddSnippet(166, "This set of commands defines various parameters that affect the results of queries or request information about the run status.");
MGCAddSnippet(167, "Returns the LVS comparison result.");
MGCAddSnippet(168, "Sets the cell context for queries.");
MGCAddSnippet(169, "Filters out result shapes that do not have a minimum width and height. Marker squares produced by Query Server commands are never filtered. ");
MGCAddSnippet(170, "Specifies which devices get queried.");
MGCAddSnippet(171, "Specifies which device seed layers get queried.");
MGCAddSnippet(172, "Specifies a distance from a query location in which to search for objects.");
MGCAddSnippet(173, "Specifies which PHDB layers get queried.");
MGCAddSnippet(174, "Adds or removes layers in the current layer query list.");
MGCAddSnippet(175, "Specifies regions that are queried.");
MGCAddSnippet(176, "Specifies a size of marker square to be used by commands that set markers. A new size is effective beginning with the next server response.");
MGCAddSnippet(177, "Sets the maximum vertex count for results in all clients. Output polygons having more than the specified number of vertices are partitioned into polygons having fewer vertices.");
MGCAddSnippet(178, "Provides the state of server settings.");
MGCAddSnippet(179, "This set of commands transforms output geometric coordinates from other commands.");
MGCAddSnippet(180, "Multiplies output coordinates by a positive factor. The MAGNIFY RESULTS transformation is applied after any REFLECTX RESULTS or ROTATE RESULTS transformations (in that order), regardless of the order in which they are issued to the server. ");
MGCAddSnippet(181, "Reflects output y coordinates across the x axis. If YES is specified, the reflection is performed before any other transformations.");
MGCAddSnippet(182, "Rotates output coordinates about the database origin by an integral multiple of 90 degrees. The positive direction is counter-clockwise. The ROTATE RESULTS transformation is applied after any REFLECTX RESULTS transformations, regardless of the order in which they are issued to the server.");
MGCAddSnippet(183, "Displaces output coordinates by specified values. The TRANSLATE RESULTS transformation is applied after any REFLECTX RESULTS, ROTATE RESULTS, or MAGNIFY RESULTS transformations (in that order), regardless of the order in which they are issued to the server.");
