MGCAddSnippet(265, "This set of commands reads netlists, identifies hcells through various manual or automatic means, and produces reports detailing effectiveness of hcells, statistics on contained instances, and so forth. Hcell lists can also be output.");
MGCAddSnippet(266, "Adds cells identified with the NETLIST AUTOMATCH or NETLIST PLACEMENTMATCH command heuristics to the system hcell list.");
MGCAddSnippet(267, "Specifies that candidate hcells are matched by name.");
MGCAddSnippet(268, "Removes a cell pair from the current hcell list maintained by the system.");
MGCAddSnippet(269, "Removes all hcell pairs from the current hcell list.");
MGCAddSnippet(270, "Specifies whether hcells in the current hcell list undergo evaluation.");
MGCAddSnippet(271, "Specifies threshold values for evaluating hcell effectiveness.");
MGCAddSnippet(272, "Specifies how to handle unbalanced hcell expansion.");
MGCAddSnippet(273, "Adds an hcell pair to the current hcell list maintained by the system.");
MGCAddSnippet(274, "Reads in an existing hcell list.");
MGCAddSnippet(275, "Specifies that candidate hcells are matched by placement count.");
MGCAddSnippet(276, "Reads the rule file for netlist information.");
