MGCAddSnippet(279, "Sets the current hcell list and generates an evaluation report.");
MGCAddSnippet(280, "Lists the current status of netlist analysis commands and whether the netlists and rule file have been read.");
MGCAddSnippet(281, "Hcell lists specify cells that correspond between layout and source netlists. Judicious selection of hcells can make Calibre nmLVS-H comparison run much faster than otherwise is possible. The Query Server can assist in constructing hcell lists.");
MGCAddSnippet(282, "Following are examples using standard Query Server commands for hcell list generation and reporting. The scripts can either be used interactively in the Query Server shell or used in a runtime script.");
MGCAddSnippet(283, "The NETLIST REPORT HIERARCHY command produces a report of cells found in the source or layout hierarchy. Cells that would make good hcells appear in order of priority, from top to bottom, in the table found in the report. ");
MGCAddSnippet(284, "This procedure is for parasitic extraction flows that use xcells. This shows the historical hcell list generation commands.");
MGCAddSnippet(285, "The Calibre Connectivity Interface (CCI) provides downstream silicon modeling tools access to extracted layout connectivity information. This information includes layout shapes, nets, devices, rule file configuration details, and corresponding schematic or source names. Third-party parasitic extractors are an example of potential clients for this interface.");
MGCAddSnippet(286, "Calibre Connectivity Interface commands are implemented in the Query Server Tcl shell and in Calibre YieldServer.");
MGCAddSnippet(287, "Conflicting annotated device layers exist when there is more than one annotated layer used for a single device. This can be an important consideration when using CCI device annotation commands.");
MGCAddSnippet(288, "Returns a Tcl list of layers that are used for annotations on particular devices.");
MGCAddSnippet(289, "Returns the layer map scheme of annotated layout output.");
MGCAddSnippet(290, "Returns a listing of information about cell ports in the layout design.");
MGCAddSnippet(291, "Configures AGF output settings for the qs::write_agf command.");
MGCAddSnippet(292, "Writes an annotated AGF file.");
MGCAddSnippet(293, "Writes a cell extents file. ");
MGCAddSnippet(294, "Writes a Layout Netlist Names correspondence file.");
MGCAddSnippet(295, "Returns a summary report of LVS rule settings.");
MGCAddSnippet(296, "Writes pushdown separated properties (PDSP) to a file.");
MGCAddSnippet(297, "ERC TVF commands support device parameter calculations for the pushdown separate properties (PDSP) flow. These device parameters are only available from the PDSP files generated by CCI. The commands are Tcl based and appear in TVF Function procedures referenced by the ERC TVF specification statement in the rule file.  ERC TVF commands are not executed in the Query Server Tcl shell. However, they are only used in a PDSP flow, so they are documented together with the Query Server CCI APIs that support the PDSP flow.");
MGCAddSnippet(298, "Returns TRUE (1) if the current run is in  Preflight  testing mode and FALSE (0) during Calibre executive modules. This command is useful to prevent Tcl code from being executed when the Tcl interpreter validates code in an ERC TVF procedure.");
MGCAddSnippet(299, "Calculates parallel device count and global coordinates properties for the CCI pushdown separated properties (PDSP) flow. These properties are not computed during LVS circuit extraction (calibre -spice), so they do not appear in the extracted layout netlist, nor are they available during LVS comparison.");
MGCAddSnippet(300, "Device properties appear in the extracted layout netlist used in LVS-H and in netlists produced by CCI. There are differences in how these properties are specified and the circumstances under which they appear in these netlists. This topic is of particular concern when LVS Push Devices SEPARATE PROPERTIES YES is specified in the rules (the PDSP flow).");
MGCAddSnippet(301, "CCI files are used by third-party tools for post-LVS flows. This procedure shows how to generate the files.");
MGCAddSnippet(302, "The Calibre Connectivity Interface is used to generate a number of formatted files used by downstream simulation tools. These files are produced by Tcl shell and standard interface commands.");
MGCAddSnippet(303, "This section describes how individual instances and nets are identified in the IXF, NXF, LPH, and SPH cross-reference files. ");
MGCAddSnippet(304, "The layout placement hierarchy file (LPH) and the source placement hierarchy file (SPH) describe the hierarchical structure of the layout and source, respectively. They map cell instances to cell names in the layout and source. These files complement the IXF and NXF cross-reference files. Note, the terms placement and instance are used interchangeably in this discussion.");
MGCAddSnippet(305, "Cross-reference files show correspondences between layout and source objects as determined by LVS. ");
MGCAddSnippet(306, "CCI generates a custom SPICE netlist for use by downstream tools.");
MGCAddSnippet(307, "Specifies a correspondence between net number annotations in an AGF file and user-names in the layout netlist. ");
MGCAddSnippet(308, "Shows locations and layers of port objects.");
MGCAddSnippet(309, "The reduction data file contains information about the types of reduction transformations that have occurred in the layout and source designs during LVS comparison.");
MGCAddSnippet(310, "The separated properties file is generated for the PDSP flow and shows separated properties for affected devices.");
MGCAddSnippet(311, "Pushdown separated properties is an LVS flow that allows for efficient handling of device properties used by third-party parasitic extraction tools. These properties are not typically used in LVS comparison, and they do not appear in the extracted layout netlist. CCI employs a number of commands specific to this flow.");
MGCAddSnippet(312, "This procedure describes a basic configuration of a rule file and CCI script to get PDSP properties for downstream simulation tools.");
MGCAddSnippet(313, "Rule file query commands provide information about LVS settings in the rule file used to generate an SVDB. These are useful in a CCI flow. As with most Query Server commands, there are Tcl shell and standard shell variants.");
MGCAddSnippet(314, "This procedure shows how to generate a flat CCI netlist for one device type.");
MGCAddSnippet(315, "Connect and Device layers are available in the PHDB. This procedure discusses how to output them to an AGF file.");
MGCAddSnippet(316, "This procedure creates a flat netlist containing all R devices with model name FUSE, with schematic instance pathnames and top-level coordinates, representing center points of the fuse devices. ");
MGCAddSnippet(317, "The standard interface dates to the origin of the Query Server. It is superseded by the Tcl shell interface because of the latter s flexibility when it comes to scripting and use in Calibre YieldServer.");
MGCAddSnippet(318, "Annotated device layers have DFM properties attached to them, which are used to annotate devices for the CCI flow. The LVS Annotate Devices specification statement must be present in the rule file for these commands to be useful.");
MGCAddSnippet(319, "Prints a report of any layers that are used for annotations on particular devices.");
MGCAddSnippet(320, "Adds or removes annotated device layers from the CCI system.");
MGCAddSnippet(321, "The CELL EXTENTS WRITE command (qs::write_cell_extents in the Tcl shell) creates a file listing the coordinates for the rectangular extents of cells in the PHDB, in each cell s coordinate space. ");
MGCAddSnippet(322, "Writes a cell extents file.");
MGCAddSnippet(323, "Annotated Geometry Format (AGF) files are GDSII stream files (version 6) or OASIS (version 1.0) files created from the layout database. GDS output uses the PROPATTR and PROPVALUE fields to specify device ids, node numbers, and instance placement names. OASIS output uses the CELLNAME, PROPNAME, PROPSTRING, and LAYERNAME records in STRICT mode. Each CELLNAME record is followed by a S_CELL_OFFSET property record to support arbitrary access. This allows multi-threaded stream-in by Calibre tools.");
MGCAddSnippet(324, "The annotated geometry format (AGF) file created by AGF WRITE can serve as input to a parasitic extraction tool. You may want to output only certain layers (perhaps the layers involved in top-level connectivity) to the stream file to simplify extraction.");
MGCAddSnippet(325, "Controls whether annotated device seed layers are output instead of original seed layers.");
MGCAddSnippet(326, "Restores the default behavior of including the same set of layers in LVS Box cells that appear in non-box cells. ");
MGCAddSnippet(327, "Clears the current list of layers specified in CCI for merging.");
MGCAddSnippet(328, "Clears the current AGF PCELL PROMOTE LAYERS list. ");
MGCAddSnippet(329, "Controls the inclusion of layers in the AGF WRITE output for LVS Box cells. This command acts independently from FILTER LAYERS settings.");
MGCAddSnippet(330, "Controls the inclusion of layers in the AGF WRITE output for LVS Box cells. Layers that are previously included or excluded have their inclusion status changed by this command. This command acts independently from FILTER LAYERS.");
MGCAddSnippet(331, "Controls whether the AGF MAP command outputs only filtered layers as specified in the FILTER LAYERS command. ");
MGCAddSnippet(332, "Controls the layout format used by AGF WRITE. ");
MGCAddSnippet(333, "Controls the hierarchy output by the AGF WRITE command. ");
MGCAddSnippet(334, "Clears the current list of cells specified with AGF HIERARCHY EXPAND CELL commands. ");
MGCAddSnippet(335, "Causes expansion of cells in AGF output. ");
MGCAddSnippet(336, "Controls automatic expansion of cells that contain no devices in them or in the lower-level placements within the cells. ");
MGCAddSnippet(337, "Returns or configures the layer map scheme of AGF output.");
MGCAddSnippet(338, "Causes a layer to be merged in AGF output.");
MGCAddSnippet(339, "Causes selected device pin layers to be merged in AGF output.");
MGCAddSnippet(340, "Configures the PROPNAME record values corresponding to PROPSTRING records in the AGF output when it is OASIS.");
MGCAddSnippet(341, "Configures the PROPATTR record values corresponding to PROPVALUE records in the AGF output when it is GDS.");
MGCAddSnippet(342, "Specifies pcell layers in the PHDB that are available for promotion in a subsequent AGF WRITE command.");
MGCAddSnippet(343, "Sets the AGF configuration commands to their default values.");
MGCAddSnippet(344, "Configures the type of device seed properties that can appear in AGF output.");
MGCAddSnippet(345, "Configures the format of AGF MAP command output.");
MGCAddSnippet(346, "Specifies the values of the UNITS record in the output of the AGF WRITE command. AGF UNITS has no other effect on CCI output.");
MGCAddSnippet(347, "Writes an annotated geometry format (AGF) file.");
MGCAddSnippet(348, "The LAYOUT NETLIST WRITE command writes a hierarchical SPICE netlist representing network connectivity in the AGF file written by AGF WRITE. The netlist and the AGF file are designed to be used together. The layout netlist is configured with the commands in the LAYOUT NETLIST family.");
MGCAddSnippet(349, "Controls whether DFM property annotated devices are used in generating a SPICE netlist.");
MGCAddSnippet(350, "Configures the LAYOUT NETLIST WRITE command to add the specified prefix in front of all cell subcircuit names in the netlist. This applies to subcircuit calls and .SUBCIRCUIT statements.");
MGCAddSnippet(351, "Cancels the current LAYOUT NETLIST CELL PREFIX command.");
MGCAddSnippet(352, "Controls whether all non-standard properties are written in comment format to the output netlist. Non-standard means not standard in regular SPICE syntax.");
MGCAddSnippet(353, "Controls device location information in the output netlist.");
MGCAddSnippet(354, "Controls the text case used for device names.");
MGCAddSnippet(355, "Controls output of device template information in the output netlist.");
MGCAddSnippet(356, "Controls whether the netlist generated by the LAYOUT NETLIST WRITE command gives calls to empty cells, like via cells. This command does not pertain to primitive subcircuits for user-defined devices.");
MGCAddSnippet(357, "Specifies the type of hierarchy to use in the output netlist.");
MGCAddSnippet(358, "Clears the cell expansion list generated by the LAYOUT NETLIST HIERARCHY EXPAND CELL command.");
MGCAddSnippet(359, "Expands the specified cell by one level in an output layout netlist.");
MGCAddSnippet(360, "Specifies whether to write the prefix for expanded names as specified by the LAYOUT NETLIST HIERARCHY setting. ");
MGCAddSnippet(361, "Controls whether model names in capacitor and resistor elements use the standard HSPICE model name field instead of the default comment-coded format. ");
MGCAddSnippet(362, "Controls whether user-defined devices use model names as subcircuit reference names in addition to the comment-coded format. ");
MGCAddSnippet(363, "Defines the origin of the net names used in the output netlist. ");
MGCAddSnippet(364, "Controls the output of pin location information. ");
MGCAddSnippet(365, "Controls the output of port information comments. ");
MGCAddSnippet(366, "Controls whether the netlist generated by the LAYOUT NETLIST WRITE command provides primitive device subcircuits for user-defined devices.");
MGCAddSnippet(367, "Reports bad DFM property annotated devices.");
MGCAddSnippet(368, "Returns the CCI netlist generation system to its default values.");
MGCAddSnippet(369, "Controls the output of separated properties to the CCI netlist.");
MGCAddSnippet(370, "Controls the output of string properties. String properties produced with the device property computation language are output by the LAYOUT NETLIST WRITE command by default.");
MGCAddSnippet(371, "Controls the writing of trivial pins to the output netlist.");
MGCAddSnippet(372, "Controls the output of reduced layout instance and net names.");
MGCAddSnippet(373, "Writes the customized layout netlist from the CCI system.");
MGCAddSnippet(374, "Writes pushdown separated properties (PDSP) to a file. ");
MGCAddSnippet(375, "Returns current layout netlist generation settings. This command is useful prior to using LAYOUT NETLIST WRITE to check the current configuration of the netlisting environment.");
MGCAddSnippet(376, "The Layout Netlist Names (LNN) file provides mapping between net numbers and user-specified (texted) net names in the customized hierarchical layout netlist. ");
MGCAddSnippet(377, "Writes a Layout Netlist Names correspondence file.");
MGCAddSnippet(378, "The PORT TABLE WRITE and qs::port_table commands write a file that lists locations of ports identified in the design. PORT TABLE NAME POLYGON PORTS (or qs::port_table ‑name_polygon_ports) can modify the output to give names to Port Layer Polygon port objects.");
MGCAddSnippet(379, "Writes a port information file.");
MGCAddSnippet(380, "Controls whether Port Layer Polygon objects are named in port tables.");
MGCAddSnippet(381, "Reduction data files contain information about reduction transformations that occur during LVS comparison. Each command producing this data allows selection of the design (source or layout) whose data is to be written, along with the type of reduction data (net or instance) to write, and optionally a single reduction reason to which the data is to be constrained.");
MGCAddSnippet(382, "Writes a file containing information about transformation reductions occurring in LVS comparison.");
MGCAddSnippet(383, "Cross-reference files indicate correspondences between nets and instances in source and layout netlists. ");
MGCAddSnippet(384, "Specifies the hierarchy delimiter character.");
MGCAddSnippet(385, "Writes a Layout or Source Placement Hierarchy file.");
MGCAddSnippet(386, "Writes an instance cross-reference file (IXF).");
MGCAddSnippet(387, "Writes a Layout Net Cross-Reference File (LNXF).");
MGCAddSnippet(388, "Writes a Net Cross-reference File (NXF).");
